import React, {useState} from 'react';
import Socket, { socket } from '../socket/socket';

export default function Lobby() {
    const [gameId, setGameId] = useState({});
    const getGameUrl = () => {
        socket.on('createGameLobby', (gameId) => {
            setGameId(gameId);
        })
    }
    return (
        <div>
            <div>
                Welcome to online chess!
            </div>
            <button onClick={() => getGameUrl()}>Click</button>

            <div>
                {gameId}
            </div>
        </div>
    )
}
